// component/CamionCard.js

import React from "react";

const CamionCard = ({ camion: { title, description, picture, html } }) => {
    return (
        <>
            <h3>{title}</h3>
            <img src={picture} className="responsive-img" alt="" />
            <p>{description}</p>
            <p>{html}</p>
        </>
    )
}


export default CamionCard;
